import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Wait for a "Your Profile" link to appear (multiple exist, use first visible)
    const profileLink = await page.waitForSelector('a:text("Your Profile")', { timeout: 5000 });

    // Take screenshot before clicking
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_profile_link_visible.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_profile_link_visible.png'));

    // Click the "Your Profile" link
    await profileLink.click();

    // Wait for Jun's profile to appear (look for Jun's name or username)
    // Wait for either full name or username text
    let profileHeader;
    try {
      profileHeader = await page.waitForSelector('text=Jun Kim', { timeout: 5000 });
    } catch {
      // Try username as fallback
      profileHeader = await page.waitForSelector('text=@jun', { timeout: 5000 });
    }

    // Take screenshot of profile page
    await page.screenshot({ path: path.join(screenshotsDir, 'step_3_jun_profile.png') });
    screenshots.push(path.join(screenshotsDir, 'step_3_jun_profile.png'));

    // Extract Jun's profile name and username for verification
    const fullName = await page.$eval('.profile-info h2', el => el.textContent.trim());
    const username = await page.$eval('.profile-info .username', el => el.textContent.trim());

    return {
      success: true,
      action: "Navigated to Jun's Profile page and verified profile info",
      extractedData: {
        fullName,
        username
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
